import React, { Component } from "react"
import AddToDo from "../components/AddToDo"

class ToDoPage extends React.Component {
  constructor(props) {
    super(props)
    this.state = {}
  }
  render() {
    return (
      <div>
        <h1>todos</h1>
        <AddToDo />
      </div>
    )
  }
}

export default ToDoPage
